    const a = await fetch("/api/seat/1");
    const b = await a.json();
    setReviewList(b);
  };

  useEffect(() => {
    getReviewList();
  }, []);

  return (
    <>
      <h1>자리 내용</h1>
    </>
  );
}

export default Seat;
